use sp_std::collections::btree_map::BTreeMap;

use cf_chains::Bitcoin;
use codec::Decode;
use pallet_cf_ingress_egress::OwedAmountScaled;
use sp_runtime::AccountId32;

pub const PREWITNESSED_DEPOSIT_ID: u64 = 13881;

/// Then raw contents of the bitcoin boost pool at block
/// 0xffb441c0d6c45c79b88dd2e31b7ed6355cffae14761bf8c45fdc351ccad35f43
fn raw_pending_boosts() -> [u8; 9328] {
	hex_literal::hex!("")
}

pub fn scaled_boost_contributions_from_raw() -> BTreeMap<AccountId32, OwedAmountScaled<Bitcoin>> {
	pallet_cf_ingress_egress::BoostPool::decode(&mut &raw_pending_boosts()[..])
		.unwrap()
		.pending_boosts
		.get(&PREWITNESSED_DEPOSIT_ID)
		.unwrap()
		.clone()
}
